(93, 1, '2020-10-20 11:30:08', '2020-10-20 10:30:08', '<!-- wp:quote {\"align\":\"center\"} -->\n<blockquote class=\"wp-block-quote has-text-align-center\"><p>\"Dost thou love life? Then do not squander time, for that is the stuff life is made of.</p><cite><strong>Benjamin Franklin</strong></cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Perhaps if i were to tell you to give me a cheque of one million dollars for a project, you would shuffle your legs under the table and give me one hundred reasons why this cannot be possible. Yet, if i walk into your office to chat with you, talk about weather, the political situation in the country and the character of the men in position, for three hours or more you might not really mind. you might not be worried and may see anything bad in it.</p>\n<!-- /wp:paragraph -->', 'Why should I Manage my Time', '', 'publish', 'open', 'open', '', 'why-should-i-manage-my-time', '', '', '2020-10-20 18:15:54', '2020-10-20 17:15:54', '', 0, 'http://localhost/noyawears/?p=93', 0, 'post', '', 0),
